import { Link } from 'react-router-dom';      

function Navbar() {      
  return (      
    <nav className="bg-gray-800 p-4">      
      <div className="max-w-4xl mx-auto flex justify-center items-center">      
        <div className="text-white text-3xl font-bold mr-8">Polygon Panda Party</div> {/* Increased font size to text-3xl */}      
        <div className="flex">      
          <Link to="/winners">      
            <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600 mx-2">      
              üèÜ View Current Winners      
            </button>      
          </Link>      
          <Link to="/past-winners">      
            <button className="bg-purple-500 text-white px-4 py-2 rounded hover:bg-purple-600 mx-2">      
              üìú View Past Winners      
            </button>      
          </Link>      
        </div>      
      </div>      
    </nav>      
  );      
}      

export default Navbar;
